import React from 'react'
import '../Styles/dashbord.css'

const Dashboard = () => {
  return (
    <div className='event-banner-shape'>
        <div className='event-banner'>
            <h1 className='event-banner-title'>Event title</h1>
        </div>
    </div>
  )
}

export default Dashboard
